module.exports.deployLilVillainsMinter = async ({ deployer, subscriptionId, coordinator, keyHash }) => {
  const LilVillainsMinter = await ethers.getContractFactory('LilVillainsMinter', deployer);
  const lilVillainsMinter = await LilVillainsMinter.deploy(subscriptionId, coordinator, keyHash);
  await lilVillainsMinter.deployed();

  return lilVillainsMinter;
};
